function Loads({ loads }) {

  loadsList = loads.map(load => {
    return (
      <li key={load.id}>
        {load.pickup_address}
        {load.dropoff_address}
      </li>
    )
  })

  return (
    <div>
      <ul>
        {loadsList}
      </ul>
    </div>
  )

}

export default Loads;
